/* eslint-disable react/jsx-no-undef */
import './App.css';
import Navbar from './navbar/Navbar';
import React, {Component} from 'react';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
     <>
       <Router>
         <Navbar/>
         <Switch>
           <Route path='/' exact />
         </Switch>
       </Router>
     </>
    );
  }
}

export default App;
